import React from "react";
import "../styles/teamPage.css";
import Navbar from "../components/Navbar";

function TeamPage() {
    // Store image paths dynamically
    const teamImages = [
        require("../assets/april.png"),
        require("../assets/lalain.png"),
        require("../assets/harold.png"),
        require("../assets/jovic.png"),
        require("../assets/thomas.png"),
        require("../assets/antonio.png"),
        require("../assets/gabriel.png"),
        require("../assets/precy.png"),
        require("../assets/thomas-sk.png"),
        require("../assets/kepperpaul.png"),
        require("../assets/aaron.png"),
        require("../assets/rojean.png"),
        require("../assets/cris.png"),
        require("../assets/michael.png"),
        require("../assets/william.png"),
        require("../assets/ivan.png"),
        require("../assets/kap.jpg"),
        require("../assets/ruel.png"),
        require("../assets/sk-team.jpg")
    ];

    return (
        <div className="teamPage">
            <div className="teamPageBg"></div>
            <Navbar />
            <div className="teamHeader">
                <h1 className="teamTitle">Sangguniang Barangay</h1>
                <h2 className="teamSubtext">Leaders Committed to Community Service</h2>
                <p className="teamDesc">
                    The Sangguniang Barangay is dedicated to governing and improving our community.
                    Through leadership, transparency, and service, we ensure the well-being and development of our barangay.
                </p>
            </div>

            {/* Mapping over teamImages array */}
            <div className="teamImg">
                {teamImages.map((image, index) => (
                    <img key={index} src={image} alt={`Team member ${index + 1}`} className="teamMemberImage" />
                ))}
            </div>

        </div>
    );
}

export default TeamPage;
